Adventure Virtual World, Aka Adventure World

&nbsp;

I'm keeping Final Sigma

progressive deck up to 3rd gen

&nbsp;

no strategy... sorry

The idea is to use Tribrigade engine to fake out some handtraps or get to rescue cat to summon up some trouble. I like the scareclaw level threes since they are <strong>Level 3 Earth Beasts</strong>, They are perfect special summons for naturia beast summon or cicada king/gossip shadow. Then of course the boss monster requires generic effect monsters so just use whatever then get your trap negate by getting reich heart search from link 3.

&nbsp;

Side note: I was play testing with simorgh in extra deck before ban list hit so I changed it up but otherwise... I still like simorgh shenanigans.

Well, they've unbanned more pendulum stuff, and Beyond the Pendulum is coming out.

&nbsp;

Might as well.

This is <a data-name="Meteonis Draconids">Meteonis Draconids</a> Beatdown with <a data-name="Skill Drain">Skill Drain</a>. Yes.

&nbsp;

You can search for ANY trap using Drytron. Why? That's because this is one of the few deck that can use <a data-name="Beatrice">Beatrice</a> AND <a data-name="Auroradon">Auroradon</a> in the same turn. The quick explanation is that Beatrice would send a trap to the GY and Auroradon would add it to your hand.

This strategy was way better when Imperial Order wasn't banned and Herald was alive, but it still is a respectable side among (usus) the many Drytron variants.

&nbsp;

This deck can also search for <a data-name="Prisoner of Destiny">Prisoner of Destiny</a> and use it in the opponent turn (with masquerena) to negate a key card.

&nbsp;

&nbsp;

GLHF
